import "./Card2.css";
import img_L from "../img/LeftArrowNative.svg";
import img_R from "../img/RightArrowNative.svg";
import RoundKnobL from "./RoundKnobL";
import RoundKnobR from "./RoundKnobR";
import Button_1 from "./Button_1";

function Card2(props) {
  const { title, scope, url, i, sc } = props;

  return (
    <div className="Card2">
      <div className="SpacingC22"></div>
      <div className="my_portfolio">My Portfolio</div>
      <div className="MyFrontend_Wrap">
        <div className="MyFrontend"> My Frontend Projects </div>
        <div className="knobsC2">
          <div>
            <RoundKnobL i={i} sc={sc}>
              <img className="imgL" src={img_L} />
            </RoundKnobL>
          </div>
          <div>
            <RoundKnobR i={i} sc={sc}>
              <img className="imgL" src={img_R} />
            </RoundKnobR>
          </div>
          <div>
            <Button_1 innerText={"Home"} url="Home" />
          </div>
        </div>
      </div>
      <div className="titleWrap">
        <div>
          <div className="titleP">{title}</div>
          <div className="scope">{scope}</div>
        </div>
        <div>
          <img className="imgP" src={url} />
        </div>
      </div>
    </div>
  );
}
export default Card2;
